import React from "react";
import Overview from "../Overview/Overview";
import { motion } from "framer-motion";
function Home() {
  return (
    <motion.div
      initial={{ y: -600 , scale:0 }}
      animate={{ y: 0, scale:2 }}
     
      transition={{
        type: "spring",
        stiffness: 260,
        damping: 20, 
        x:{ duration:0.5 }
      }}
    >
      <Overview />
    </motion.div>
  );
}

export default Home;
